    for item in value_list:
        if item['category'] == 'Money market funds':
            if 'Total Fair Value' in item['header2']:
                money_market_value += item['number_value']
            elif 'Total Fair Value' in item['header2']:
                money_market_value += item['number_value']

        if 'Significant Other Observable Inputs (Level 2)' in item['header2']:
            level2_total_value += item['number_value']

    if level2_total_value == 0:
