    proportion = (money_market_value / level2_total_value) * 100
    return (round(proportion, 2), "percent")

def run(value_list):
    """
    Calculates the proportion of Total FairValue made up of level 2 inputs.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale) representing the proportion.
    """
    total_level2_value = 0
    for item in value_list:
        if item['category'] == 'Total':
            continue
        if 'Significant Other Observable Inputs (Level 2)' in item['header2']:
            total_level2_value += item['number_value']

    total_fair_value = value_list[len(value_list) - 1]['number_value']

    if total_fair_value == 0:
        proportion = 0.00
    else:
        proportion = (total_level2_value / total_fair_value) * 100

    return (round(proportion, 2), 'percent')

