        A tuple (number, scale) representing the total provision for income taxes
        between 2017 and 2019.
    """
    total_provision = 0.0
    for item in value_list:
        if item['header1'] == 'Provision for income taxes':
            if 'header2' in item and item['header2'] == '2017':
                total_provision += float(item['number_value'])
            elif 'header2' in item and item['header2'] == '2018':
                total_provision += float(item['number_value'])
            elif 'header2' in item and item['header2'] == '2019':
                total_provision += float(item['number_value'])

    if total_provision == 0:
        return (0.00, "")

    scale = ""
    if total_provision >= 1000000:
        scale = "Million"
    elif total_provision >= 1000:
        scale = "Thousand"
    elif total_provision >= 100:
        scale = "Hundred"
    elif total_provision >= 10:
        scale = "Ten"
    elif total_provision >= 1:
        scale = "One"

    return (round(total_provision, 2), scale)

