    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale).
    """

    def extract_value(data, category, year):
        for item in data:
            if item['category'] == category and item['header1'] == 'Total' and item['scale'] == '':
                if year in item['header1']:
                    return item['number_value']
        return None

    goodwill_2018_ns = extract_value(value_list, 'Goodwill acquired', 'Network Software & Systems')
    goodwill_2019_ns = extract_value(value_list, 'Goodwill acquired', 'Network Software & Systems')

    if goodwill_2018_ns is not None and goodwill_2019_ns is not None:
        change = (goodwill_2019_ns - goodwill_2018_ns) / goodwill_2018_ns * 100
        return (round(change, 2), 'percent')
    else:
        return (None, '')

